-- Table structure for `salary`
-- ----------------------------
DROP TABLE IF EXISTS `salary`;
CREATE TABLE `salary` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `basic_salary` decimal(8,2) DEFAULT NULL COMMENT '基本工资',
  `post_salary` decimal(8,2) DEFAULT NULL COMMENT '岗位工资',
  `confidentiality_fee` decimal(8,2) DEFAULT NULL COMMENT '保密费用',
  `subsidy` decimal(8,2) DEFAULT NULL COMMENT '补贴',
  `internship_subsidy` decimal(8,2) DEFAULT NULL COMMENT '实习/兼职补贴',
  `performance_bonus` decimal(8,2) DEFAULT NULL COMMENT '绩效奖金',
  `other_additions` decimal(8,2) DEFAULT NULL COMMENT '其他加给',
  `mid_night_shift_subsidy` decimal(8,2) DEFAULT NULL COMMENT '中/夜班补贴',
  `overtime_pay` decimal(8,2) DEFAULT NULL COMMENT '加班工资',
  `total_payable_salay` decimal(8,2) DEFAULT NULL COMMENT '当月应发工资合计',
  `post_deduction` decimal(8,2) DEFAULT NULL COMMENT '差岗日扣款',
  `leave_deduction` decimal(8,2) DEFAULT NULL COMMENT '事假扣款',
  `sick_leave_deduction` decimal(8,2) DEFAULT NULL COMMENT '病假扣款',
  `other_deduction` decimal(8,2) DEFAULT NULL COMMENT '其他扣款',
  `total_actual_salary` decimal(8,2) DEFAULT NULL COMMENT '当月实际工资合计',
  `expends_base` decimal(8,2) DEFAULT NULL COMMENT '缴费基数',
  `fund` decimal(8,2) DEFAULT NULL COMMENT '公积金',
  `social_security` decimal(8,2) DEFAULT NULL COMMENT '社保',
  `total_salary_reduce_other` decimal(8,2) DEFAULT NULL COMMENT '扣除社保公积金工资合计',
  `income_tax` decimal(8,2) DEFAULT NULL COMMENT '当月所得税',
  `total_salary_to_card` decimal(8,2) DEFAULT NULL COMMENT '实发到卡金额',
  `year` char(6) NOT NULL,
  `month` char(4) NOT NULL,
  `staff_id` int(10) unsigned NOT NULL COMMENT '员工id',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_year_month` (`year`,`month`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

