-- Table structure for `staff`
-- ----------------------------
DROP TABLE IF EXISTS `staff`;
CREATE TABLE `staff` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `staff_name` char(80) NOT NULL COMMENT '员工姓名',
  `id_card` char(18) NOT NULL COMMENT '身份证号',
  `mobile` char(20) DEFAULT NULL COMMENT '手机号码',
  `email` char(60) DEFAULT NULL COMMENT '邮箱',
  `pwd` varchar(255) NOT NULL COMMENT '登陆密码',
  `work_num` varchar(255) DEFAULT NULL COMMENT '员工工号',
  `sex` enum('M','F') DEFAULT 'M' COMMENT '性别',
  `dept_id` int(11) DEFAULT '1' COMMENT '部门ID',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '员工状态1为正常0为异常',
  `last_ip` char(255) DEFAULT NULL COMMENT '最后一次登陆IP',
  `last_time` timestamp NULL DEFAULT NULL COMMENT '最后一次登陆时间',
  `remember_token` varchar(100) DEFAULT NULL COMMENT '用于修改密码的',
  `expiration_time` timestamp NULL DEFAULT NULL COMMENT '过期时间',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_card` (`id_card`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

